import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

  const numberOfLayer = 19;
  const imgLayerPrefix = "multilevelimage000L";
  const imgLayerFileExtencions = "png";

  class Layer extends React.Component{
    render(){
      let randomNumber = Math.floor(0.1);//Math.random()*numberOfLayer);
      return <p  class="text-center"> {randomNumber}</p>;
    }
  }

  ReactDOM.render(
  <Layer />,
  document.getElementById('root')
);
